import React, { useState } from 'react';
import axios from 'axios';

const Registrar= () => {
  const [product, setProduct] = useState([]);
  const [nombreProducto, setNombreProducto] = useState('');
  const [precioProducto, setPrecioProducto] = useState('');
  const [id, setId] = useState('');

 const fetchData = async () => {
    const res = await axios.get('http://localhost:8080/api/v1/products');
    console.log(res.data);
 };

 const createData = async () => {
    await axios.post('http://localhost:8080/api/v1/products', {
      nombreProducto,
      precioProducto,
    });
    fetchData();
 };

 return (
    <form>
      <label>
        Nombre producto
        <input type="text" value={nombreProducto} onChange={(e) => setNombreProducto(e.target.value)} />
      </label>
      <label>
        Precio
        <input type="text" value={precioProducto} onChange={(e) => setPrecioProducto(e.target.value)} />
      </label>
      
      <button type="button" onClick={createData}>
        Crear persona
      </button>
    </form>
 );
};

export default Registrar;
